import React from 'react'
import './Headline.css'

export default class Headline extends React.Component {
  constructor(props) {
    super(props)
  }
  componentDidMount() {
  }
  render() {
    return(
      <div className="newsHeadline">
        <div className="headline">
          <div className="nameSubreddit"><p>{this.props.title.length > 90 ? `${this.props.title.substring(0,900)}...` : this.props.title}</p></div>
          <div className="headlineSubreddit"><p>{this.props.subreddit}</p></div>
        </div>
        <div className="newsThumbnail">{this.props.thumbnail}</div>
      </div>
    )
  }
}
